import './App.css';
import Navbar from './components/navbar';
import Home from './components/home';
import About from './components/about';
import {Routes, Route} from 'react-router-dom'

function App() {
  return (
    <div>
      <Navbar />
      <Routes>
        <Route path='/' exact>
          <Home />
        </Route>
        <Route path='/about' element={<About/>}></Route>
      </Routes>
    </div>
  );
}

export default App;
